tables.table_schema:
CREATE TABLE genetic_sequence_data (
  id INT PRIMARY KEY,
  sequence TEXT NOT NULL,
  label TEXT NOT NULL,
  created_at TIMESTAMP
);

CREATE TABLE genomics_data (
  id SERIAL PRIMARY KEY,
  sequence TEXT NOT NULL,
  label TEXT NOT NULL
);

CREATE TABLE model_parameters (
  parameter_id SERIAL PRIMARY KEY,
  parameter_name TEXT NOT NULL,
  parameter_value FLOAT NOT NULL
);

CREATE TABLE GenomeSequences (
    sequence_id INT PRIMARY KEY,
    sequence_data TEXT,
    sequence_length INT
);

CREATE TABLE SequenceAnnotations (
    annotation_id INT PRIMARY KEY,
    sequence_id INT,
    annotation_text TEXT,
    annotation_type VARCHAR(50)
);

CREATE TABLE SequenceData (
    sequence_id UUID PRIMARY KEY,
    sequence_data VARCHAR(255),
    sequence_length INT
);

CREATE TABLE ModelData (
    model_id UUID PRIMARY KEY,
    model_name VARCHAR(50),
    model_type VARCHAR(50),
    training_epochs INT
);

CREATE TABLE ResearcherData (
    researcher_id UUID PRIMARY KEY,
    researcher_name VARCHAR(100),
    researcher_email VARCHAR(100)
);

CREATE TABLE ExperimentResults (
    result_id UUID PRIMARY KEY,
    experiment_id UUID,
    model_id UUID,
    accuracy FLOAT
);

CREATE TABLE genetic_sequences (
  sequence_id UUID PRIMARY KEY,
  sequence_data TEXT,
  sequence_length INT
);

CREATE TABLE genes (
  gene_id UUID PRIMARY KEY,
  gene_name VARCHAR(50),
  species_name VARCHAR(50)
);

CREATE TABLE mutations (
  mutation_id UUID PRIMARY KEY,
  mutation_type VARCHAR(50),
  effect_on_gene VARCHAR(100)
);

CREATE TABLE genomics_researchers (
  researcher_id UUID PRIMARY KEY,
  researcher_name VARCHAR(50),
  institution VARCHAR(100)
);

CREATE TABLE experiments (
  experiment_id UUID PRIMARY KEY,
  experiment_date DATE,
  researcher_id UUID REFERENCES genomics_researchers(researcher_id)
);
